(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-1e00be06"],{"20c8":function(e,a,n){"use strict";n.r(a);var t=function(){var e=this,a=e.$createElement,n=e._self._c||a;return n("div",{staticClass:"cv-con",attrs:{id:"print-vis-on"}},[n("h1",{staticClass:"main"},[e._v("Hamish Clulee")]),n("h2",[e._v("BSc, Software Engineering, University of Otago")]),n("h3",[e._v("References upon request")]),n("h5",[e._v("hamish.clulee@gmail.com")]),n("h6",[e._v("Digital Nomad, primarily located in Asia.")]),n("h6",[e._v("New Zealand Citizen.")]),n("div",{staticClass:"fin-con"},[e._v("~")]),e._m(0),n("div",{staticClass:"fin-con"},[e._v("~")]),e._l(e.jobs,function(a,t){return n("div",{key:t,staticClass:"job-con"},[n("h2",[e._v(e._s(a.employer))]),n("h3",[e._v(e._s(a.title))]),n("h5",[e._v(e._s(a.dates))]),a.references?n("h6",{staticClass:"refs"},[e._v("References available")]):e._e(),e._l(a.description,function(a,t){return n("p",{key:t,domProps:{innerHTML:e._s(a)}})}),n("div",{staticClass:"fin-con"},[e._v("~")])],2)})],2)},s=[function(){var e=this,a=e.$createElement,n=e._self._c||a;return n("div",{staticClass:"key-con"},[n("h6",{staticClass:"exp-head"},[e._v("Commercial Environments & Production Web Applications")]),n("p",[n("em",[e._v("VueJs")]),e._v(" - 3+ years")]),n("p",[e._v("Javascript - 4+ years")]),n("p",[e._v("Java - 4+ years")]),n("p",[e._v("SASS/SCSS/CSS 4+ years")]),n("p",[e._v("NodeJs - 2+ years")]),n("p",[e._v("Linux - 4+ years")]),n("h6",{staticClass:"exp-head"},[e._v("Other relevant skills")]),n("p",[e._v("Working Remote - 3+ years")]),n("p",[e._v("Web Development - 5+ years")]),n("p",[e._v("Gimp/Inkscape (linux graphics and images editors) - 5+ years")])])}],i=(n("cadf"),n("551c"),n("097d"),{name:"cv",data:function(){return{jobs:[{title:"Full Stack Web Developer",employer:"Freelancing",dates:"April 2015 - Present (4+ years)",description:["Since early 2015 I have taken on a number of freelance web dev jobs, both while working \n                            in waged positions and as a full time freelancer.","Breif summary of works:","<ul>",'<li>Scratch build a booking, payment and calendar management app for @RONIN, \n                            a company that provides co-working and co-living spaces for digital nomads. \n                            Currently under developement. Details on the <a href="/work">projects page</a>.</li>','<li>Scratch build a booking, payment and staff allocation app for BabyAidNZ, an \n                            education outfit in New Zealand. Details on the <a href="/work">projects page</a>.</li>',"<li>A growing number of static websites/brochurewear sites, built using Vue and Sass and self \n                            hosted on DigitalOcean.</li>","</ul>","~","Almost everything I do while freelancing finds a way to make use of <em>VueJs</em> in some way, \n                            shape or form."],references:!0},{title:"Senior Frontend Developer",employer:"Netograph",dates:"August 2018 - August 2019 (1 year 1 month)",description:['Netograph provides a web app and an API service, their frontend is written in <em>VueJs</em> \n                            and Typescript, backed by a custom webpack configuration. Visualisations are written in \n                            d3.js. I was responsible for the vast majority of the frontend code currently hosted at \n                            <a href="https://netograph.io" target="_blank">https://netpgraph.io</a>.',"Netograph's product is data. That data is gathered by a web crawler. Beginning by crawling \n                            open social media platforms like Twitter and 4chan, each crawler thread searches for URLS, and visits those \n                            encountered usin a headless browser and\n                            records information like IP addresses, subdomains, SSL certificates, satellites, roots, aliases and more.\n                            Netographs servers then cross index for connections with existing data. \n                            At the time I left there were over 2000 threads, which performed a capture in \n                            around 2 minutes and were constantly running. Netograph has a staggering amount of data, \n                            19 billion (and counting) http request pairs captured, with major domains like google and \n                            facebook having millions of data points associated with them.","The primary frontend challenges then revolved around presenting that level of complexity, and \n                            scale, in a user friendly manner.",'Note worthy achievements include, the \n                            <a href="https://netograph.io/datasets/social/" target="_blank">infinite scroll library</a>,\n                            which had to act in place of pagination due to how lists are displayed and indexed.  \n                            Custom <a href="https://netograph.io/datasets/social/domain/facebook.com" target="_blank">masonary cards</a> \n                            , designed to show the user a sample of the data in each list, remembering that each list could \n                            contain over a million items, and each first class object (IPs, domains, superdomains) could contain \n                            up to 10 lists. A <a href="https://netograph.io/datasets/social" target="_blank">search component</a>, \n                            letting users find needles in a gigantic haystack, in a manner that was quick and easy.','Finally, Netograph captures privacy and cookie policy pages. \n                            The text and layout data is captured prior \n                            to the painting and rendering stage in the browser lifecycle. \n                            Each capture displayed in the app shows the captured text, overlaying its captured position  \n                            in a full page screenshot of URL in question, text is then searchable and sortable.\n                            You can check it\n                            out <a href="https://netograph.io/datasets/social/recentpolicies" target="_blank">here</a>.',"Overall, this was an awesome developement experience.",'<span class="remote">This was a 100% remote position</span>'],references:!0},{title:"Contract Frontend Developer",employer:"Allow Design",dates:"Intermittent between January 2017 - February 2019 (Contracts totalling 9+ months)",description:["Allow Design was a studio based in Dunedin, New Zealand. They had one primary client, \n                            a US healthcare giant. They would create functioning mini applications as development \n                            templates for devs that worked directly for healthcare firm.","I was employed on and off for a number of these prototypes, creating small, standalone \n                            web apps from a series of \n                            Photoshop files provided by a Allow designer.","I was also responsible for overhauling \n                            the frontend tooling and build system to help make other contract developers more productive \n                            and make onboarding less cumbersome. \n                            I created a <em>VueJs</em> and Webpack boilerplate to function as a base for new prototypes. \n                            It included a large number of UI components that conformed to the Allow Design styleguide. \n                            The boilerplate was successful in reducing the lag created between \n                            designers and developers which occured when prototypes didn't match the styleguide, and reduced lead time. \n                            It remained in usage until the company folded early this year.","Some fun challenges, especially building a component library from scratch.",'<span class="remote">This was a 100% remote position</span>'],references:!1},{title:"Software Developer",employer:"Fusion Sport Inc.",dates:"October 2017 - April 2018 (7 months)",description:["Fusion is a sports science company, based in Brisbane, Australia. They sell hardware products \n                            and provide a web app, all designed to \n                            provide athletes and sports teams with competitive advantages.","Please note that Fusion Sport acquired Profiler Corp, where I was working \n                            at the time, details of my work at Profiler can be found below.",'The Fusion Sport Client list is impressive, you can check it out \n                            <a href="https://www.fusionsport.com/clients/" target="_blank">here</a>, \n                            working directly for internationally recognisable sports teams was a real buzz.','My main focus was Smartabase; Fusion\'s primary web product. Smartbase functions on a \n                            "data-in-insights-out" model. Most of my time at Fusion was spent on working with \n                            the frontend team, whose primary focus was building dashboards.','Note worthy achievements include, rebuilding the tooling used by the frontend team, \n                            replacing Gulp and JQuery with \n                            a custom Webpack and <em>VueJs</em> boilerplate. The new boilerplate reduced lead time \n                            by a significant amount, and is still in usage today. \n                            Being granted leadership of the Dasboard Builder project. After \n                            identifying the most commonly requested items in \n                            customer dashboards with the team, I protyped an application that enabled \n                            creation of dashboards without developer involvement.\n                            It was approved by management, and the Dashboard Builder was born. based on \n                            feedback from collegaues still working at Fusion it appears to remain a\n                            customer favorite. More details are available on the <a href="/work">projects page</a>.',"While most of my time at Fusion was spent with the frontend team, I \n                            was also responsible for providing all the API support for dashboards and the \n                            Dashboard Builder, and at times required to fill in for custom developement \n                            requests that required backend developement. \n                            This meant I spent time wrting and debugging Java on regular basis.","An awesome place to work, great team spirit, and a lot of engaging challenges.",'<span class="remote">This was a 100% remote position</span>'],references:!0},{title:"Web Application Developer",employer:"Profiler Corporation",dates:"August 2016 - October 2017 (1 year 3 months)",description:["Profiler was sports science company based in Dunedin, New Zealand. They wrote \n                            and maintained a web application called Smartabase, built to assist \n                            with management of sports teams and athlete development. The app had two main \n                            areas of focus. \n                            First, data in, users were able to create very detailed custom forms for \n                            usage after training sessions, after games and for nutrition and medical \n                            data input. Second, \n                            insights out, which was where I was orginally assigned due to my ReactJs \n                            experience and passion for UI design and build. The first few months were spent \n                            prototyping and designing a new UI for some new features planned \n                            for the 'insights out' side of the business.\n                            Pivots occured, and I shifted to being more backend focused, writing new features in Java, \n                            providing API endpoints, debugging and refactoring.","Nearer the end of my time in this position my focus shifted back to the frontend, \n                            with a most of my time being spent writing <em>VueJS</em> and beginning to increase its\n                            usage throughout the code base.","Profiler Corp was acquired by Fusion, which meant a new position, details are above.",'<span class="remote">This was a 100% remote position</span>'],references:!0}]}}}),o=i,r=(n("6a1e"),n("2877")),l=Object(r["a"])(o,t,s,!1,null,"66c8c0d5",null);l.options.__file="cv.vue";a["default"]=l.exports},"6a1e":function(e,a,n){"use strict";var t=n("7c36"),s=n.n(t);s.a},"7c36":function(e,a,n){}}]);
